# process-mrva-results 0.0.1
extensions:
- addsTo:
    extensible: typeModel
    pack: codeql/python-all
  data:
  - - flask.Blueprint~Subclass
    - flask_restx
    - Member[apidoc].Member[Apidoc]
  - - flask.Blueprint~Subclass
    - flask_restx
    - Member[apidoc].Member[Blueprint]
  - - flask.MethodView~Subclass
    - flask_restx
    - Member[Resource]
  - - flask.MethodView~Subclass
    - flask_restx
    - Member[api].Member[Resource]
  - - flask.MethodView~Subclass
    - flask_restx
    - Member[api].Member[SwaggerView]
  - - flask.MethodView~Subclass
    - flask_restx
    - Member[resource].Member[MethodView]
  - - flask.MethodView~Subclass
    - flask_restx
    - Member[resource].Member[Resource]
